package ru.spb.devpractices.masterbest.serverside.model;import lombok.Data;import javax.persistence.*;import java.io.Serializable;@Entity@Data@Table(name = "documents" )public class Document implements Serializable {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    public Long id;    @Column (name = "name")    public String name;    @Column (name = "url")    public String url;    @Enumerated (EnumType.STRING)    @Column (name = "type")    public DocumentType type;}